import React from 'react';
import { BrowserRouter as Router } from "react-router-dom";
import {
  Navbar,
  Clippeddrawer,
  CalendarCard,
  FunctionCard,
  SearchField,
} from "./components";
import styled from "styled-components";

const StyledContentContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 32px 70px;
`

import { ReactComponent as ReportsIcon } from "./assets/Document Landscape Data.svg";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar/>
        <Clippeddrawer/>
        <CalendarCard/>
        <StyledContentContainer>
        <SearchField/>
        </StyledContentContainer>
        <FunctionCard     
          id={"report"}
          text={"SITREP Reports"}
          >
            <ReportsIcon/>
          </FunctionCard>
      </Router>
    </div>
  );
}

export default App;
